CREATE POLICY customer_access ON stockbroker.portfolios AS PERMISSIVE FOR ALL TO customer USING(portfolio_id=CAST(CURRENT_USER AS int));

CREATE UNIQUE INDEX company_revenue ON stockbroker.companies USING btree (current_annual_revenue DESC);
CREATE UNIQUE INDEX positions_stock ON stockbroker.positions USING btree (current_stock DESC);

